import { useState } from 'react';
import logo from '../../assets/imgs/bold.png';

import Backdrop from '../../UI/Backdrop';
import './Header.css';

import Login from './components/Login/Login';
import Signup from './components/Signup/Signup';
import { useNavigate, BrowserRouter, Route } from 'react-router-dom';

function Header() {
	const [open, setOpen] = useState(false);

	const showModal = () => setOpen(true);
	const closeModal = () => setOpen(false);

	if (open) {
		return <Backdrop />;
	}

	const navigate = useNavigate();
	return (
		<div className='Header'>
			<div className='header-brand'>
				<img className='header-logo' alt='logo' src={logo} />

				<h1 className='header-h1'> BiaNova </h1>
			</div>

			<div className='login'>
				<p>
					<button onClick={navigate('{Login}')} className='header-btn'>
						{' '}
						Log In{' '}
					</button>{' '}
					| <button className='header-btn'> Sign Up </button>
				</p>
			</div>
		</div>
	);
}

export default Header;

<BrowserRouter>
	<div>
		<Route path='/Login' component={Login} />
		<Route path='/SignUp' component={Signup} />
	</div>
</BrowserRouter>;
